import React from "react";
import SelectLang from "../components/GetStarted/SelectLang";
import SingInBtn from "../components/GetStarted/SingInBtn";
import NetflixLogo from "../components/NetflixLogo";
import backImg from "../assets/begin-page/header-img.jpg";

const GetStarted = () => {
  return (
    <div>
      <nav className="absolute z-10 w-full left-0 flex justify-between items-center px-14 pt-7">
        <NetflixLogo />
        <div className="lang-signin">
          <SelectLang />
          <SingInBtn />
        </div>
      </nav>
      <header className="relative w-full h-737 overflow-hidden">
        <img src={backImg} alt="" className="h-full w-full object-cover" />
        <div className="absolute bg-gradient-to-b from-black via-transparent to-black w-full h-full"></div>
      </header>
    </div>
  );
};

export default GetStarted;
